import React from "react";

class MyApp extends React.Component{
      constructor()
      {
            super()
            this.state={
                  name:"Kishan",
                  age:19
            }
      }
      render()
      {
            return
            (
                  <div>
                        <h1>You are currently logged in</h1>
                   </div>
            )
            
      }
}
export default MyApp
